/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<a	class="ui5-link-root"	role="link"	href="${ifDefined(context.parsedRef)}"	target="${ifDefined(context.target)}"	rel="${ifDefined(context._rel)}"	tabindex="${ifDefined(context.tabIndex)}"	?disabled="${context.disabled}"	aria-disabled="${ifDefined(context.ariaDisabled)}"><slot></slot>	${ context.hasLinkType ? block1(context) : undefined }</a>`; };
const block1 = (context) => { return html`<span class="ui5-hidden-text">${ifDefined(context.linkTypeText)}</span>	`; };

export default block0;
